window.bookSummaryJSON = "<p>A chilling revelation about a forgotten Earth threatens the entire galaxy....</p> <p>Held captive by Dark Horse Company, Captain Axel Finn is faced with a mission to humanity’s ancestral home after all contact with the planet is lost. Learning his mother might be hiding there, Axel agrees to help his adversaries, and deploy on <i>Vengeance</i>, the last Steward ship. But his decision might lead to his downfall if the Wrath have already arrived on Earth.</p> <p>On the treacherous Wooly planet of Dari, bounty hunter Rangnar Soki becomes the prey, finding himself the target in a deadly game of survival. His path to rejoin Axel’s crew hinges on passing a test of Dari’s most revered guardian. Meanwhile, the surviving crew of the <i>Trash Squid</i> faces their own struggles to repair their damaged ship and leave Dari to find Captain Finn.</p> <p>At the Citadel, Sergeant Jax Brito returns from her harrowing mission on Corinnia after drilling into a construct brimming with alien embryos. This grim discovery sends shockwaves through the CANDF ranks, and reality dawns on them all: The countdown to the Wrath invasion was wrong; it has already started, and no part of the galaxy is safe.</p>"; 
